import React, { Component } from 'react';

export default class Home extends Component {
  state = {
  }

  render () {
      return (
      <div id="home">
          <div id="title">
            <h1> Home radi! </h1>
          </div>

          <div className="homeRoutes">
            <div id="projs">
              <a href="projects">Projects</a>
            </div>

            <div id="devs">
              <a href="developers">Developers</a>
            </div>

            <div id="reps">
              <a href="reports">Reports</a>
            </div>
          </div>

        </div>
      )
   }

}
